    <script>
      $(function(){
        var stackBefore = moment();
        for (var i = 0; i < 100000; i++) {
          var stackTest = functionalStack();
        }
        var stackAfter = moment();
        var stackTime = stackAfter.diff(stackBefore);
        var $timeResult = $('<div></div>')
        $timeResult.text('Functional Stack() took '+stackTime+' milliseconds');
        $timeResult.appendTo(document.body)
      })
    </script>
